import React, { Component, Fragment } from 'react'
import SelectItem from '../../util/SelectItem'
import '../../styles/chart.css'
import AreaChart from './AreaChart'

export default class Chart extends Component {
    state = {
        pickedTicker: null
    }

    pickHandle = (symbol) => {
        this.setState({
            pickedTicker: symbol
        })
    }
    render() {
        if(this.props.match.params.symbol) {
        console.log("CHART tickerToLOOK", this.props.match.params.symbol)
        }
    
        return (
            <div className="chart">
                <div className="chart-header">
                    <div>
                    </div>
                    <div  style={{width:"140px", padding:"0.2rem"}}>
                        <SelectItem pickHandle = {this.pickHandle}/>
                    </div>
                </div>
                <div className="chart-field">
                    <div className="chart-body" style={{backgroundColor:"yellow"}}>
                        <AreaChart tickerToLook={this.props.match.params.symbol} pickedTicker={this.state.pickedTicker}/>
                    </div>
                </div>
            </div>
        )
    }
}
